import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the "Your Profile" link to trigger the display of profile information
    // Using getByRole for a semantic, user-facing selector
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.click();

    // Wait for the profile page content to be loaded and visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();
    const totalOrders = await page.locator('.stat:has-text("Orders") .stat-number').textContent();
    const totalReviews = await page.locator('.stat:has-text("Reviews") .stat-number').textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      orders: parseInt(totalOrders.trim(), 10),
      reviews: parseInt(totalReviews.trim(), 10),
    };

    return {
      success: true,
      action: "Successfully clicked on 'Your Profile' and harvested user information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
